#include<bits/stdc++.h>
using namespace std;
int main()
{
	int n;
	cin>>n;
	int ans=0;
	for(int i=1;i<=n;i++)
	{
		for(int j=i+1;j<=n;j++)
		{
			if((i+j)%9==0)
			{
				ans++;
			}
		}
	}
	cout<<ans;
	return 0;
}
